Movie Info: Grand Masti is a Bollywood adult comedy film presented by Bharat Shah, directed by Indra Kumar and produced by Ashok Thakeria. The film is a sequel to the 2004 hit, Masti, and features Vivek Oberoi, Aftab Shivdasani and Riteish Deshmukh reprising their roles from the original, along with Bruna Abdullah, Karishma Tanna, Sonalee Kulkarni, Kainaat Arora, Maryam Zakaria and Manjari Fadnis. Grand Masti released on 13 September 2013.


